                </div>
                <ul className="navlinks">
                    <li><a href="#">Home</a></li>
                    <li><a href="#">Festivals</a></li>
                    <li><a href="#">About & Social</a></li>
                </ul>
            </nav>    
      </header>
    );
}

export default Header;
